import React, { useEffect, useRef } from 'react';
import BenefitParallaxGalleryStyle from '../../styles/components/BenefitParallaxGalleryStyle/BenefitParallaxGalleryStyle'
import ParallaxGaleryItem from './ParallaxGaleryItem'

import gsap from 'gsap';
import ScrollTrigger from 'gsap/ScrollTrigger';

function BenefitParallaxGallery () {
    gsap.registerPlugin(ScrollTrigger);
    const Ref = useRef(null);

    useEffect(() => {

        gsap.set(".hero_banner", { y: 175, yPercent: -50, yPercent: -50, opacity: 0 });
        gsap.to(".hero_banner", {
            y: 0,
            duration: 6,
            opacity: 1,
            scrollTrigger: {
              trigger: ".benefit_wrapper",
              markers: true,
              start: "top top",
              end: "center center",
              scrub: true
            }
          });

        }, [])
    return (
        <div className={`${BenefitParallaxGalleryStyle} benefit_wrapper`}>
            <div className='item' >
                <ParallaxGaleryItem position='right'></ParallaxGaleryItem>
